import "./App.css";
import GlassmorphismBox from "./components/glass";
import Navbar from "./components/navbar";
import Signup from "./pages/Signup";

function App() {
	let component;
	switch (window.location.pathname) {
		case "/":
			component = <App />;
			break;
		case "/about":
			component = <About />;
			break;
		case "/blog":
			Component = <Blog />;
			break;
		case "/signup":
			Component = <Signup />;
			break;
		case "/login":
			Component = <Login />;
			break;
	}
	return (
		<div className="App">
			<Navbar />
			<GlassmorphismBox />
			<Component />
		</div>
	);
}

export default App;
